(45, 'Ramona Schindler', 'ramona.s@pelephant.com', '41795715064', 'Contact Person For Math', 'Dear Educators,\r\nI am the founder of ModusOperandi, an app that corrects handwritten math solutions (this is a completely different concept from Photomath).\r\nhttps://modusoperandiapp.page.link/g-signup or www.onelink.to/modusoperandi.\r\nCurrently, I am looking for schools and teachers for the initial rollout who would like to test the app.\r\nCould you please provide me with the contact details of the appropriate person (e.g., math department coordinator) at your school?\r\n\r\nI look forward to hearing from you.\r\nWarm regards,\r\nRamona', 0, '2023-11-28 07:59:51', '2023-11-28 07:59:51'),
