(49, 'Anastasia', 'atarasyuk@synergy.ru', '919311066169', 'Cooperation offer', 'Dear Sir, greetings of the day!\r\nI hope this message finds you in good health and high spirits.\r\n\r\n\r\nMy name is Anastasia and I represent Synergy University, which is an esteemed international institution with campuses in both the UAE and Russia.\r\nWe already have more than 7 years of experience to work with students from India. University is proud to offer over 300 programs in various fields of study, including MBBS, engineering, and EMBA courses.\r\n\r\n\r\nWhile browsing through your website, I noticed you have numerous programs on offer but no presence in the UAE yet.\r\nI would like to bring to your attention that the UAE is becoming a popular destination among Indian students, owing to its strategic location and the government\'s focus on attracting skilled workers and students to Dubai.\r\n\r\n\r\nI am delighted to inform you that we have recently established an office in India to oversee our academic activities in the region.\r\nIn this regard, I would like to schedule a meeting with you to explore potential avenues for collaboration, programs, and admission for the 2024 intake.\r\n\r\n\r\nIt would be an honor for me to discuss this matter with you further and to explore ways in which we can collaborate.\r\nI would greatly appreciate it if you could let me know at your earliest convenience when you might be available for a meeting? \r\n\r\n\r\nThank you very much for your time and consideration.', 0, '2024-03-11 10:03:25', '2024-03-11 10:03:25'),
