(68, 'H. Farzan', 'business@johnacademy.co.uk', '02039233962', 'Collaboration Proposal', 'Hi,\r\n\r\nImagine adding over 2,500 CPD QS-accredited courses to your website, fully branded with your logo and custom pricing. With our white-labeled e-learning portal, you can seamlessly integrate these courses into your existing services, creating new revenue streams and boosting your business’s value.\r\n\r\nNo e-learning experience? No problem. Our portal is easy to set up, and our expert team will support you every step of the way. Unlock our entire course library with a minimal license purchase and start offering tailored learning solutions to your clients today.\r\n\r\nWould you be open to a short call to explore how this could benefit your business?.\r\nBest regards,\r\nH. Farzan\r\nBusiness Development Manager', 0, '2025-02-05 15:28:17', '2025-02-05 15:28:17'),
