INSERT INTO `c_m_s_settings` (`id`, `about_intro`, `where_we_offer`, `what_we_offer`, `history`, `who_we_are`, `overseas_consultant`, `team_content`, `our_advisors`, `education_advisors`, `why_us_arr`, `contact_text`, `feedback_text`, `press_release_text`, `new_hightlights_text`, `video_gallery_text`, `upcoming_event_text`, `scholarship_text`, `results_text`, `iets_exam_text`, `created_at`, `updated_at`, `home_title`, `home_subtitle`, `about_home`) VALUES
(1, '<p>At the Knowledge Kingdom, our core activity lies in assisting students and guide them to make the perfect choice with regard to pursuing education to Study Abroad Consultants in Bhopal. Knowledge Kingdom not only gives the right direction to the students for choosing their courses but also advise the best country for the students for their best career.</p>\r\n\r\n<p>Sometimes students are confused about which course they prefer and in which country they have to go to. That&rsquo;s why we also provide career counselling and personal counselling, so the doubt of the students should be clear.</p>', '<p><strong>Where we offer</strong></p>\r\n\r\n<p><strong>We provide vital information regarding higher education in various countries such as UK, USA, Canada, Australia, NewZealand, Singapore, Ireland, France, Germany, Dubai, Switzerland, Malaysia and many more. Knowledge Kingdom, a pioneer in the field of &ldquo;GLOBAL EDUCATION&rdquo; and has brought the concept of overseas education to the doorstep of every student.</strong></p>\r\n\r\n<p><strong>Our exquisite branch network and association with leading institutions worldwide and unblemished reputation help us to deliver you the top quality education services. In addition to professional academic and career counselling.</strong></p>', 'Knowledge Kingdom also offers various students quality services such as aptitude testing, course and university selection, streamlined application process guidance and assistance, admission and visa guidance, accommodation assistance at best price, test prep for IELTS, TOEFL, PTE, GMAT, GRE, SAT. We also provide bank loan help, travel assistance with an economical fare, foreign exchange assistance, medical and travel insurance and comprehensive pre-departure guidance and provide assistance at each step.', 'Knowledge Kingdom has organized over 400 educational fairs and exhibitions across India in the past 11 years and proved itself top overseas education consultant in Bhopal. Knowledge Kingdom represents a wide portfolio of reputed international institutions &amp; works closely with several organizations, high commissions &amp; education bodies.', 'Knowledge Kingdom is India&rsquo;s Leading Overseas Education Consultancy and has helped thousands of students achieve their dreams. The group of experts at Knowledge Kingdom whole up to more than 450 people crosswise over different offices. Despite students/parents knowing what they wish to study and where they usually avail our professional services to ensure better quality and hassle-free application process thus allowing them and give them chance to focus on their academics and job. We have sent more than 6000 students in the last 15 years and we are 17-year-old Study Abroad Consultancy in Bhopal.', 'We are growing not only in Bhopal and we are No 1. Overseas consultant in Bhopal. The people in the team are dedicated towards the students; needs and fulfil commitments given to the students. Our counsellors have travelled abroad for training and also have been trained by visiting international experts to guide students professionally in selecting the right course at the ideal institution with an economical fee structure.', 'The management team of Knowledge Kingdom are highly qualified professionals having rich experience in the field of overseas education. The two partners have studied, worked and lived abroad and undergo specialized training at various universities around the globe. This knowledge and experience of overseas education have been systematically and successfully downloaded to its large team of academic advisors. Overseas education Our team is passionate about helping students for establishing their successful careers and leaves no stone unturned to ensure great results which makes us the best Foreign Education Consultants in Bhopal.', '<p>Live by a strict code of ethics and present a set of values that are not merely etched in stone but are woven into the very fabric of the organization which is very essential. The meticulous training regime and internal certification process at Knowledge Kingdom ensure that all our advisors have surpassed industry benchmarks before they commence counselling and guide the students for their career. They simplify the process and assist students and parents through the maze of information overload and assist the right match to achieve the goals that the students have set out.</p>\r\n\r\n<p><strong>Being the best study abroad consultants in Bhopal, we also provide free consultants.</strong></p>', 'The passionate team of Knowledge Kingdom, the backbone of the organization, consists of dynamic and professionals counsellors, who have vast and deep professional experience in the field of advising students about the various study options available in India and abroad, keeping their academic profile and needs in mind.', '<ul>\r\n	<li>Representatives of different universities from UK, USA, Canada, Australia, New Zealand, Singapore, Ireland, France, Germany, Switzerland, Malaysia and many more.</li>\r\n	<li>Choice of Universities/ Colleges with affordable and economical tuition fees and hassle-free admissions.</li>\r\n	<li>There are IELTS registration center for IDP</li>\r\n	<li>We also provide personalized coaching for IELTS, PTE, TOEFL, GRE, GMAT, SAT and ACT. through preparatory material and CDs by an experienced trainer and a well-equipped digital library.</li>\r\n	<li>An experienced team of professional and experienced counsellors and mentors that personally assist students and parents in the application and visa process to the representative university. We are the best visa consultant in Bhopal.</li>\r\n	<li>Full focus on matching the profile of students with the right institution and destination.</li>\r\n	<li>Hosting direct interviews with the university representatives.</li>\r\n	<li>Helping in understanding the visa processes.</li>\r\n	<li>Full assistance on travel, accommodation &amp; foreign exchange.</li>\r\n	<li>Experienced and professional leadership Team with substantial experience and background in the field of education</li>\r\n	<li>Knowledge Kingdom prides itself on its personalized attention to students and parents and consciously seeks to avoid an assembly line approach to counselling students.</li>\r\n	<li>Exhaustive information in the form of library CD&rsquo;s, brochures, academic guides, application forms etc.</li>\r\n	<li>We Organize many international education fairs in India.</li>\r\n	<li>We also assist students with follow on academic programs to post completion of their primary academic programs.</li>\r\n	<li>We have a strong understanding of international post-study work opportunities, jobs, opening economic and industry trends and permanent residency policies.</li>\r\n	<li>Over the years has placed several thousand students enrol at their desired institutions, make successful careers and successfully established themselves overseas.</li>\r\n	<li>All Students across India have trusted the Knowledge Kingdom for their career decisions and placements.</li>\r\n	<li>Our student and parent testimonials speak of unmatched service experiences with full assistance to all process.</li>\r\n</ul>', 'Knowledgekingdom Contact', 'Knowledgekingdom Feedback', 'knowledgekingdom&nbsp;PRESS RELEASE&nbsp;', 'jjkkljl', 'hgjhghjggjh', NULL, '<p>Don&rsquo;t let a great opportunity to slip out of your hands.</p>\r\n\r\n<p>We know you have doubts about study overseas program, cost of moving abroad and even- increasing international student fees, the matter of a study abroad course is really expensive which will make you think twice. What you may not be aware of is Knowledge Kingdom has a plan for you; we are associated with various organizations who intend to support students who wish to study abroad. The availability of scholarship assistance is like a blessing in disguise.</p>\r\n\r\n<p>Scholarships can be a useful means to sustain your existence in a foreign country. With the aim to support inspirational and life ambitioned students who have a dream to make their family proud we are connected with these organizations who intend to provide scholarships to these students. But one needs to prove themselves worthy enough to get the scholarship. We are fully intent you to get the scholarship and ensure than you are eligible to apply for the scholarship. Below are the list of scholarships and organizations we are connected with, there are various options available through which one can get scholarship, for full information regarding the scholarship contact our office or visit knowledge kingdom, you don&rsquo;t have to worry Knowledge kingdom is here to make your dreams turn into a reality by supporting you with full means, either its study or financial needs, knowledge kingdom is here to help you get to your dreams.</p>\r\n\r\n<p>With you for you always, be a part of knowledge kingdom and fly high!</p>', '<p>Until you spread your wings you have no idea how high you&rsquo;ll fly, once you spread your wings you will reach new heights of glory.</p>\r\n\r\n<p>Want to hear some amazing stories! For many year knowledge kingdom have trained students for various study abroad entrance exams like IELTS, TOEFL, GRE, GMAT, SAT, students have proven to be determined and focused about the exams and their will to study in a foreign institution. Below are the short amazing, inspiring and proof of determination stories of our student&rsquo;s victory and an example of how knowledge kingdom has become the leading overseas consultancy of Bhopal. We hope these stories may inspire you to take up your dream and reach your goal. With the support of our team and with the help of the amazing faculty, students of knowledge kingdom have scored golden stars in their results. Results are the simple and the most powerful way to show the world how capable you are, to show the world that you are not less than anyone. Let the world be negative about your decision and you just prove them how capable you are.</p>\r\n\r\n<p>Having a positive attitude towards your abilities will lead you to success. Hard work and determination are the 2 main objects which will help you lead to your goals. Knowledge kingdom is here to make your will more strong. Students of knowledge kingdom have proven that the will to succeed is the key to all your answers, here is a glimpse of success that our students achieved in the path of reaching their goals!</p>', NULL, NULL, '2025-06-07 06:58:18', 'Welcome to Knowledge Kingdom', 'STUDY ABROAD CONSULTANCY IN BHOPAL', 'Knowledge Kingdom is a leading Study Abroad Consultants, Study Overseas Consultants in Bhopal. We being the Overseas Education Consultants offers students with the opportunity to study overseas. With the guidance and support of our team, many students have completed their wish to study in foreign universities.<br />\r\n<br />\r\nBeing the supreme Foreign Education Consultants in Bhopal, we offer students&nbsp;<a href=\"https://knowledgekingdom.in/ielts-coaching-bhopal\">IELTS classes in Bhopal</a>,&nbsp;<a href=\"https://knowledgekingdom.in/toefl-coaching-bhopal\">TOEFL classes in Bhopal</a>,&nbsp;<a href=\"https://knowledgekingdom.in/sat-coaching-bhopal\">SAT classes in Bhopal</a>,&nbsp;<a href=\"https://knowledgekingdom.in/gre-coaching-bhopal\">GRE classes in Bhopal</a>, and&nbsp;<a href=\"https://knowledgekingdom.in/gmat-coaching-bhopal\">GMAT classes in Bhopal</a>, in performing the best we nurture them. Knowledge Kingdom provides students with guidance and counselling to make the right decision according to their interest.<br />\r\n<br />\r\nBeing authorised with various foreign institution we advise our students about the educational facilities provided. Knowledge Kingdom gives the best possible service to their students and gives them the guarantee to help them in getting the best career orientated universities.');
INSERT INTO `faqs` (`id`, `faq_cat`, `question`, `answer`, `status`, `created_at`, `updated_at`) VALUES
(1, '3', 'When is the right time for submitting the Application?', 'Indian students aiming for the 2025 and 2026 intake should start their preparations 6-12 months in advance. Application Deadlines Vary. For more information, call us @9893484938', 1, '2023-07-05 12:45:36', '2025-06-02 05:43:05'),
(3, '4', 'What documents are required for applying in foreign universities?', '<p>All your marksheets, Passport, IELTS Score card, LORs and SOPs are some mandatory documents required. Call us @9893484938 for all the details.</p>', 1, '2025-06-02 05:47:04', '2025-06-02 05:47:04'),
(4, '5', 'Do you offer classes for IELTS/GRE/GMAT/PTE/ etc?', 'Yes. We&#39;ve experienced faculty who prepare students in personalised sessions for all the above-mentioned exams. Contact: 9893484938', 1, '2025-06-02 05:52:22', '2025-06-02 05:52:22'),
(5, '5', 'Where can I find details for various courses and programs?', 'For detailed information and all current updates, our team members are one call away. Get in touch today! Call: 9893484938', 1, '2025-06-02 06:02:42', '2025-06-02 06:02:42'),
(6, '10', 'Which exam should I give if I wish to study abroad?', '<p>Every country and university has their specific requirements. It completely depends on your course. For further assistance, you can reach out @9893484938</p>', 1, '2025-06-02 06:06:18', '2025-06-02 06:06:18'),
(7, '10', 'How can I prepare for international entrance exams?', 'Knowledge Kingdom Study Abroad Consultants offer meticulous and engaging courses that have helped many students in clearing their international exams. Get in touch with us to book a free demo.', 1, '2025-06-02 06:08:40', '2025-06-02 06:08:40');
