INSERT INTO `testimonials` (`id`, `name`, `image`, `address`, `description`, `status`, `created_at`, `updated_at`) VALUES
(5, 'Tanshiq Patil', 'public/image/admin/testimonial/Ge0UqZLxaz141HKC6VQxx5BrVdZQ9k9O7u2l6x9o.jpg', 'University College London, UK', '<p><var>I would highly recommend Knowledge Kingdom for anyone considering studying overseas. Their guidance throughout my journey starting from efficiently crafting the applications to seamless visa processing has been truly invaluable. They helped me make informed decisions at every step of the way and addressed all of my concerns promptly and thoroughly. A special mention to Shilpa Ma&rsquo;am and Mani Ma&rsquo;am who were incredibly supportive during what can be a very daunting process. I am immensely grateful for their guidance and if you&#39;re considering studying abroad, look no further than Knowledge Kingdom.</var></p>', 1, '2023-07-08 06:56:48', '2025-06-02 04:33:37'),
(6, 'Mansi Gupta', 'public/image/admin/testimonial/4iqLUujdoVmhVB1XlY22gOOpCj95K72WROSex6WE.jpg', 'Liverpool John Moores University, UK', '<p><var>Excellent place to get your process started. Mani mam and her team is very supportive and strive their level best to complete the process with ease and at the same time fast. They have provided me with my offer letter and visa within a month, overall a highly recommended place.</var></p>', 1, '2023-07-08 06:57:32', '2025-06-02 05:05:15'),
(7, 'Arush Bhadoria', 'public/image/admin/testimonial/Bs2HO60epWUVpKNlM1cWJGLIkxVvmhfPnvt5oJcf.jpg', 'Dublin City University, Ireland', '<var>I had an outstanding experience with Knowledge Kingdom for my study abroad journey. From the very beginning, they were incredibly supportive and knowledgeable, guiding me through every step of the process with ease. They helped me with everything, from selecting the correct course for my masters and right university to preparing my documents and even assisting with my IELTS and PTE exam.<br />\r\nThe team was always available to answer my questions and made sure I was well-prepared and confident at every stage. Their attention to detail and personalized service truly set them apart. Thanks to their expert guidance, I was able to navigate the complex application process smoothly and secure my place at Dublin City University.<br />\r\nA special thanks to Mani Ma&rsquo;am and Ashita ma&rsquo;am for her exceptional guidance. She went above and beyond to ensure I was well-prepared and confident at every stage<br />\r\nI highly recommend Knowledge kingdom to anyone looking to study abroad. Their professionalism, dedication, and genuine care for their clients make them an invaluable partner in this journey. I&rsquo;m incredibly grateful for all their help</var>', 1, '2023-07-08 06:58:16', '2025-06-02 04:26:37'),
(8, 'Mahee Chouksey', 'public/image/admin/testimonial/U7vrepN5RKErjcZZgPv8HrlMyxGWzHzapa0Nvhru.jpg', 'Queen Mary University of London, UK', '<p><var>First of all, I&#39;m so glad &amp; excited to talk about Knowledge Kingdom, which is the most professional &amp; dedicated to their service excellence. I took their service. This is the best, trustworthy, well-organised foreign study consultant.</var></p>\r\n\r\n<p><var>I would like to give my heartiest thanks &amp; gratitude to Knowledge Kingdom and especially to Mani Mam, who is the most helpful, patient, proficient and friendly as well. I got UK student visa with the assistant of them and I believe I made the right choice. I had an amazing experience in the institute. Very co-operative staff. Special thanks to Mani ma&#39;am and Shilpa ma&#39;am.</var></p>\r\n<var>I would recommend those who want to pursue foreign education to choose Knowledge Kingdom. They are really so reliable.</var>', 1, '2023-07-08 06:59:11', '2025-06-02 04:22:17'),
(9, 'Simran Raghuwanshi', 'public/image/admin/testimonial/9vCrxrhypEu5dANOeYArSXxeqigLC4Axx3ew7Koc.jpg', 'National College of Ireland, Ireland', '<var>Best consultant ever, they are very good and specially shilpa mam and mani mam they will contact you for each and every thing and also they are very friendly. Highly recommended</var>', 1, '2023-07-08 06:59:48', '2025-06-02 05:06:07'),
(10, 'Ram Kishor Baghel', 'public/image/admin/testimonial/fNc8jYqT7Rl6QwXpUg9MIsqnQtEnJ6Ro8wC2BI32.jpg', 'Bangor University, UK', '<var>My experience with Knowledge Kingdom has been amazing. My counselor very meticulously planned my application and visa process and guided me well about the pre and post departure. This wouldn&rsquo;t have been possible without Knowledge Kingdom. Thank you for tolerating all my fears, answering all my queries and doubts and bringing the confidence in me. Thank you for all the efforts and support and for making my dream comes true!</var>', 1, '2023-07-08 07:00:28', '2025-06-02 05:06:56'),
(11, 'Ankita Pathak', 'public/image/admin/testimonial/RVSW1zkJDLU30KV2Y8xoMoGDRd7yqxvXaHa0XBY1.jpg', 'Staffordshire University, UK', 'Knowledge Kingdom was referred to me by a friend. I got all the guidance and support from team Knowledge Kingdom. All the counselors are very well qualified. They all have gone through the whole visa process themselves, which makes them even more suited for providing guidance. I cannot thank the team enough for all their help and highly recommend Knowledge Kingdom to any college applicant.', 1, '2023-07-08 07:01:15', '2023-07-08 07:01:15'),
(12, 'Majinder Singh Natt', 'public/image/admin/testimonial/2JcVuoyr837QeXk3g6e2fYICqJrzdCd4d8WK1y5X.jpg', 'Fleming College, Canada', 'I was fortunate enough to walk straight up to Knowledge Kingdom and get everything done under one roof. You have always been welcoming and whatever doubts I have had, you have cleared them in a courteous way rather than condescending. You have helped me when I needed, replied to me emails without delay and without fail, helped me arrange all the required documents in advance so that I don&rsquo;t have any troubles, helped me prepare for my visa and apart from all this, you have also been helpful with my family who were very concerned about me all this while. For this reason having an understanding counselor is really important. I and always be grateful for guiding me all this time.', 0, '2023-07-08 07:06:27', '2023-07-08 07:06:27'),
(13, 'Rohan Parashar', 'public/image/admin/testimonial/TRiOuo7uClmKvBrtIv2K7iJbXv7ie0kHDtGUFSq3.jpg', 'University of Liverpool, United Kingdom', '<p>I would like to thank Mani Mam, who guided me throughout my visa process journey.If she wasn&#39;t there I wouldn&#39;t have received my student visa for UK within a short span of 24 hours. They made sure that no details were missed and would let me know when things had to be done. Knowledge Kingdom team&rsquo;s support, and understanding of the process and intricacies of the visa system made the process very smooth and straightforward which otherwise would have been very stressful.</p>', 1, '2023-09-29 09:19:58', '2023-09-29 09:19:58'),
(14, 'Devyani Khare', 'public/image/admin/testimonial/bUC3MjXqo5PeaNOuCCtDxK8DSGy54r65rmN4zZyq.jpg', 'University College Dublin, Ireland', '<p>I would like to take a moment and appreciate your efforts in helping me in my dream of studying abroad. Mani Mam and team Knowledge Kingdom had done a great job all through the journey. Right from the preparation of IELTS, offer till getting the visa done you have helped and guided me. I will certainly recommend my close friends and future applicants from the city of Bhopal to definitely reach out to Mani madam and her team for their extremely superior customer service.</p>', 1, '2023-09-29 09:20:43', '2023-09-29 09:20:43'),
(15, 'Shivika Gupta', 'public/image/admin/testimonial/I3LF9hgHKYv9ysTCQgI3EZiDLDJNbumX1XeCMm1n.jpg', 'Dublin Business School, Ireland', '<p>I have faced lots of issues when it comes to getting in the DESIRE College in Dublin, but knowledge Kingdom has guided me from getting an offer letter to visa. It was tough for me as I wasn&#39;t present in Bhopal, but with the help of knowledge Kingdom it seems easy. Thank you so much for everything and because of Knowledge Kingdom only I am able to achieve my goal, and now I will go to Ireland for my further studies. Knowledge Kingdom changed my dream into reality. Once again thank you so much for everything you have done for me.</p>', 1, '2023-09-29 09:22:05', '2023-09-29 09:22:05'),
(16, 'Syed BabishHussain', 'public/image/admin/testimonial/AybRRPShiROOF63s29Icq3InIpN1nMJQJCy8ViP1.jpg', 'University College Dublin, Ireland', 'Knowledge Kingdom proves that high standards in name and services can go hand in hand. I have my Irish visa with me and am going there with my friends who got their visa process done by Knowledge Kingdom. We applied to a lot of universities for my chosen course and got accepted in all. We zeroed in on University College Dublin and then they helped me further in the Visa process right from collecting the necessary documents to applying for visa and making everything fail-proof. I was really glad that I had Knowledge Kingdom Team&rsquo;s support it&rsquo;s commendable of them to reach out to me always well in advance with everything ready so I didn&rsquo;t miss any deadlines. I&rsquo;ve gotten my visa for Ireland and I&rsquo;ll attend University College Dublin. Thank you all for the immense support. It would not have been possible without you guys', 1, '2023-09-29 09:22:52', '2023-09-29 09:22:52'),
(17, 'Arjun Singh Baghel', 'public/image/admin/testimonial/Gl6Y5Xb88EA31jpHatGfj9c06GPoeHzmU3fbTCCi.jpg', 'Manipal Academy of Higher Education, Dubai', '<p>I did waste a lot of time searching for the best Course &amp;University in Dubai and I was pretty much behind my schedule, Knowledge Kingdom helped me save one precious year by instantaneously getting me an admission to a university of my choice and the course of my preference. As well as getting me a visa in just 2 weeks and put me on a plane right before my orientation week at the university. I wish them all the very best.</p>', 1, '2023-09-29 09:23:46', '2023-09-29 09:25:22'),
(18, 'Naman Shrivastava', 'public/image/admin/testimonial/MEgZpNNkY14PCkNGvx5IPVJNEVhFIQfskaTBVkPe.jpg', 'Sheffield Hallam University, UK', '<p>I am glad that I approached Knowledge Kingdom. The staff&rsquo;s takes each and every student very seriously and hold themselves accountable towards every student equally. Since the day I discussed my plan for Mastersmam has given me proper guidance and help in everything. From day 1 till I reached UK she was always in touch with me. Entire documentation process and Visa application process was done by Knowledge Kingdom. If you are planning for a hassle free and tension free admission in UK you can 100% trust Knowledge Kingdom.</p>', 1, '2023-09-29 09:24:25', '2023-09-29 09:24:25'),
(19, 'Tanvi Sawai', 'public/image/admin/testimonial/uomPIdocA05sCjJ8uP56b1hXS4UObqRqmgFFeAIm.jpg', 'University College Dublin, Ireland', '<p>Coming to Knowledge Kingdom was a very wise decision I took when it comes to applying for post graduate studies in Ireland. From applying for the offer to applying for my VISA, Knowledge Kingdom assisted me thoroughly at every step. I recall many times Knowledge Kingdom went out of their way to help me for instance, going through the process. The service offered is without a doubt priceless and I would recommend anyone applying for a student visa at Ireland to go through them to avoid unnecessary confusion and delays.</p>', 1, '2023-09-29 09:28:41', '2023-09-29 09:28:41'),
(20, 'Arshdeep KaurHanda', 'public/image/admin/testimonial/mFATqmxQq1Qui1OdJcB4xTlPpCX0PlKmiIzpi1rU.jpg', 'RMIT University, Australia', '<p>Knowledge Kingdomwas supporting me during the entire process of my application.They were very helpful for the minute details of my application as and when required. Because of team knowledge kingdom I got admission in RMIT University, Australia. I am very grateful and thankful to all theteam members of Knowledge Kingdom. I will hold these memories forever. Experiences of hard work during hard times remain in memories forever</p>', 1, '2023-09-29 09:29:16', '2023-09-29 09:29:16'),
(21, 'Anshul Bharadwaj', 'public/image/admin/testimonial/fa9j3A2Wb6x97judF2NqkCtVk6nYm3a6X5ENCZzI.jpg', 'National College of Ireland, Ireland', '<p>I got in touch with Knowledge Kingdom when I have to give my IELTS exam. Interacting with Mani ma&rsquo;am was a really insightful experience with her knowledge of my favoured country. She was always ready for exploring other options as well as reinforcing my original idea. What interested me the most was their connections with colleges and universities of abroad. I was guided very well for each of my query by team Knowledge Kingdom. I am very happy with their services. Thank you</p>', 1, '2023-09-29 09:29:50', '2023-09-29 09:29:50'),
(22, 'Raghvendra Singh Thakur', 'public/image/admin/testimonial/2v4t1p4CB22Fw1JTl8tMe7C7ukDkz2o3QTgr5aR3.jpg', 'Leeds Beckett University, UK', '<p>Here I feel privileged to convey my gratitude to team knowledge kingdom for assisting me they scheduled my appointment on time and make sure every single document is perfect. Without Knowledge Kingdom my master&#39;s plan will still be a dream. I can&rsquo;t thank enough Mani Mam for the huge support and help during the entire process.</p>', 1, '2023-09-29 09:30:58', '2023-09-29 09:30:58'),
(23, 'Prasan Dubey', 'public/image/admin/testimonial/vlSD92a6sViaitgiVHEWru1xSK91XpRM3EoFavrw.jpg', 'University of Limerick, Ireland', '<p>I received excellent support from Knowledge Kingdom throughout my Ireland student visa process. In spite of limited time to manage my student visa application, knowledge kingdom has been very prompt for everything required time to time. Special thanks to Shilpa for daily follow-ups. The best part is, they have always explained each step of process with utmost patience and perfection. The best consultancy to go to if you want to pursue your career abroad.</p>', 1, '2023-09-29 09:31:35', '2023-09-29 09:31:35'),
(24, 'Aayush Singhai', 'public/image/admin/testimonial/IyKq7LvKJmeI2GkkolFQmIpVFNQaZ7O6tstcJ0Xa.jpg', 'University Canada West, Canada', '<p>Getting into a top university is much easier to dream than reality, I was baffled for a couple of months with the information on &quot;How to get into Top Ranked Institutes&quot; over the internet. The whole thing went smoothly from Admissions to Visa at Knowledge Kingdom. They helped me a lot in getting what I dreamt off. The counselor was very informative and helpful. I would thank Knowledge Kingdom to make me take the correct decision for my bright career.</p>', 1, '2023-09-29 09:32:03', '2023-09-29 09:32:03'),
(25, 'Shivendra Singh', 'public/image/admin/testimonial/qREqlbitw2NGaxF1eLTXY6dDBzA6c40GIyeKp51r.jpg', 'Seneca College, Canada', '<p>The professional services offered by knowledge kingdom &amp; their personal involvement insisted me to retain them as my agency for the process of my student visa of Canada. They are quiet transparent throughout the process. They have thoroughly assisted me with every bit of information required&nbsp; throughout the process. Thank you team Knowledge Kingdom for all the support.</p>', 1, '2023-09-29 09:32:34', '2023-09-29 09:32:34'),
(26, 'Sanjeev Mukund Rao', 'public/image/admin/testimonial/YLrEd8vMVIpgUY0CxMwQeXsCAMZM21oF2WOIKUpc.jpg', 'Niagara College, Canada', '<p>Canada was being portrayed as a tough choice for foreign education when I approached few abroad education canters. My friend who has already gone there through Knowledge Kingdom suggested me to go there. And when I went to Knowledge Kingdom I knew why my friend was easily settled in Canada; because they provide all services very efficiently. Thanks a ton Knowledge Kingdom for the excellent support.</p>', 1, '2023-09-29 09:33:12', '2023-09-29 09:33:12'),
(27, 'Chris George', 'public/image/admin/testimonial/6nc5vEVug09ONGOtq72rch7BMb78b66q7hQNOvlX.jpg', 'Trinity Western University, Canada', '<p>I am glad that I got to know about Knowledge Kingdom and received their service to bring my dream true for higher studying at Trinity Western University, Canada with scholarship. They assisted me all the way it was possible for them till I come to Canada even after that as well. Thanks Knowledge Kingdom for your continuous support and I wish you very good luck!</p>', 1, '2023-09-29 09:34:47', '2023-09-29 09:34:47'),
(28, 'Ikram Shakeel', 'public/image/admin/testimonial/88idt0m7DRteSIa8EbyJ7xr7epOEX1cqDG4EPyvE.jpg', 'Arden University, Germany', '<p>A good consultant who can advise students to do the right thing I put my 100% trust on Knowledge Kingdom. Shilpahas always been there for me not only as a student but also as a great friend. Delivered excellence services throughout my journey from University admission to until get the student visa and made my dream true for studying in Germany. Even still they are supporting me by providing career counselling and so on. Thanks knowledge kingdom for your wonderful support.</p>', 1, '2023-09-29 09:36:56', '2023-09-29 09:36:56'),
(29, 'Simran Raghuwanshi', 'public/image/admin/testimonial/5oRX0DzLFGAKiUzYcjpBfSfacbJ2rFTHRbCf2fvo.jpg', 'National College of Ireland, Ireland', '<p>Best consultant ever, they are very good and speciallyShilpa mam and Mani mam they will contact you for each and every thing and also they are very friendly, cooperative and trustworthy. Thanks Knowledge kingdom for all of your support since beginning of my admission process. I&rsquo;m very glad to know them and will strongly recommend other students.</p>', 1, '2023-09-29 09:37:30', '2023-09-29 09:37:30'),
(30, 'Amisha Patel', 'public/image/admin/testimonial/6oczFRyJsFGHNvZg89QDbxvB6YQIX21CvVAl6yVe.jpg', 'College of Ireland, Ireland', '<p>I am pleased I found knowledge kingdom they assisted me in selecting best course to apply, in visa, in all the documents, and what not?Professionalism at its best.They are the best consultants in Bhopal.&nbsp;Good choice for consulting abroad study details. You will be satisfied with its service.</p>', 1, '2023-09-29 09:38:09', '2023-09-29 09:38:09'),
(31, 'Avneet Singh Bhatia', 'public/image/admin/testimonial/PR1aICzqEZ1sZBWP24x1mWEkQF6vL8Th2pBfzAkj.jpg', 'George Brown College, Canada', '<p>Everyone stated that pre-admission process for foreign institutions is very expensive. Few consultants asked for a huge sum of amount before even the process started. Thanks to knowledge kingdom they not only helped with the Student visa but also did not ask for any counselling fees. My mentor guided me for admissions in Canada; she had a very helpful and cordial approach. I was confused earlier but she gave me enough choices according to my desired interest and profile.</p>', 1, '2023-09-29 09:38:44', '2023-09-29 09:38:44'),
(32, 'Ram Kishore Baghel', 'public/image/admin/testimonial/MplQcDcGJNmXv9Luki3QtgNmneGO88nIJrsxKdPk.jpg', 'Bangor University, UK', '<p>I am glad that I approached knowledge kingdom well in time. The staff&rsquo;s takes each and every student very seriously and hold themselves accountable towards every student equally. I would want to thank knowledge kingdom from the bottom of my heart, for what I am today. I can vouch for the fact that knowledge kingdom has the most motivating, encouraging and supportive counsels. This makes knowledge kingdom the best foreign education consultants in Bhopal.</p>', 1, '2023-09-29 09:39:23', '2023-09-29 09:39:23'),
(33, 'Raghav Dewra', 'public/image/admin/testimonial/tBJyEIiQJOUP41VfQTa0sQy9XLmsxwq8t58QW394.jpg', 'University of Manchester, UK', '<p>Thanks to knowledge kingdom for the wonderful support they gave me. From getting admission, visa process to accommodation all in one. Knowledge kingdom is just not only an education consultant firm; they are all-rounder for studying abroad support. I would highly recommend everyone to choose knowledge kingdom as your next step for studying especially in Europe and other countries.</p>', 0, '2023-09-29 09:40:44', '2023-09-29 09:40:44'),
(34, 'Abeer Sharma', 'public/image/admin/testimonial/zOjU7y2wDoVY8T4ZHzpi1QeGeEkkH9U3kDimauPp.jpg', 'Queen Mary University of London, UK', '<p>I am obliged to knowledge kingdom throughout my life. They show me right path and pull me up from the level of depression after so many failures. With their excellent service support, I made my dream possible to study abroad and accelerate my career further. I felt there is no substitute of their expertise for United Kingdom student visa process. I am highly satisfied with the service provided by team knowledge kingdom.</p>', 1, '2023-09-29 09:41:14', '2023-09-29 09:41:14'),
(35, 'Sajal Vijayvargiya', 'public/image/admin/testimonial/vDh7saokBkaq8o37FsYcUP5Byc1jIUvYfPgYGabI.jpg', 'Oxford Brookes University, UK', '<p>You have given me a chance to achieve my dreams and live them. It seemed a little difficult but you made it possible for me. With all your support and guidance I reached so far. I promise to the Team of knowledge kingdom I will always try to make you proud of me where ever I am. You guys were a great help not only for my process but gave me support and confidence professionally as well as personally. Thank You Team Knowledge Kingdom!</p>', 1, '2023-09-29 09:41:44', '2023-09-29 09:41:44'),
(36, 'Ketan Singh Parihar', 'public/image/admin/testimonial/OliCEfLV6nRI3EI878o28k2zCzmjgnAAj5cAIOhd.jpg', 'University College Dublin, Ireland', '<p>A big cheers to the whole knowledge kingdom family!! I want to extend my heartfelt thanks to Mani mam for rendering the support throughout the process of my applications and visa. She has been my biggest support system. Over all experience with team knowledge kingdom was stupendous. The Journey forth is possible only because of knowledge kingdom. Thanks a lot for this beautiful journey.</p>', 1, '2023-09-29 09:42:11', '2023-09-29 09:42:11'),
(37, 'Smriti Pandole', 'public/image/admin/testimonial/4kpaXClQgRX67rFFblUOEMzZEF5kyMMctxXjsPE2.jpg', 'Monash University,  Australia.', '<p>Knowledge Kingdom&rsquo;s guidance has been one of the most instrumental factors in securing my admission to my dream &ldquo;Monash University.&rdquo; I was made aware of everything about the process and progress throughout the entire admission and visa process. The whole process was completed just in few days which were absolutely beyond my expectation. Whenever I contacted team Knowledge Kingdom, they assisted me in the best possible way. I would definitely suggest Knowledge Kingdom to prospective students who are planning to study abroad. Thank you team Knowledge Kingdom.</p>', 1, '2023-09-29 09:43:10', '2023-09-29 09:43:10'),
(38, 'Srishti Singh Parihar', 'public/image/admin/testimonial/LmWCkQiB6dyuZoDFgeczGYqUYKEQ7cPkw8QgieBn.jpg', 'Deakin University,  Australia.', '<p>I was referred by my student who told me to visit Knowledge Kingdom, overseas education consultancy and rest would be taken care. I thank the entire team at Knowledge Kingdom who&rsquo;ve helped me accomplish my goal of getting into Deakin University which had always been my #1 choice. Every expert at Knowledge Kingdom that I associate with pushed me to deliver my best. I once like to thank each and every one for their guidance and support.</p>', 1, '2023-09-29 09:52:16', '2023-09-29 09:52:16'),
(39, 'Anjali Salve', 'public/image/admin/testimonial/dYl3LN69H618McdKEp72F2SuKE9l1Gkzt04OZbFt.jpg', 'De Montfort University,  United Kingdom.', '<p>Knowledge Kingdom is a great consultancy; they played a tremendous role for bringing a turning point in my life. Team Knowledge Kingdom left no page unturned for helping me get through the admission and visa process of UK. I would like to thank Knowledge Kingdom from the bottom of heart, for what they have done to help me achieve my dream. They were remarkably transparent throughout the process.&nbsp; Thank you team Knowledge Kingdom for instilling &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; confidence in me and encouraging me at every step of my process.</p>', 1, '2023-09-29 09:52:48', '2023-09-29 09:52:48'),
(40, 'Ankita Choudhary', 'public/image/admin/testimonial/37yB4KdBsmQhqMXkHU013LH0XY1VOK3PiR6S3Yq8.jpg', 'Northumbria University, United Kingdom.', '<p>My personal experience with Knowledge Kingdom is really nice, from the beginning of my process till now.&nbsp;</p>\r\n\r\n<p>I can assure that they are highly professional and supportive in their work with excellent team and expert knowledge of best universities out there because they will only suggest you the best options. Faster and accuracy in their work which is really good.&nbsp;</p>\r\n\r\n<p>Always focused and motivates you to choose best.&nbsp;</p>\r\n\r\n<p>I am extremely thankful to entire team of knowledge Kingdom for making my dream come true and best wishes for the future.&nbsp;</p>\r\n\r\n<p>Highly recommend for everyone who is looking for true and expert advice.&nbsp;</p>', 1, '2023-09-29 09:53:47', '2023-09-29 09:53:47'),
(41, 'Simran Arora', 'public/image/admin/testimonial/wYo2cQgbaw83MjBYlrvx6Hb9a4uConqOvVkIJB3V.jpg', 'Seneca College, Canada.', '<p>Knowledge Kingdom has helped me a lot, right from IELTS preparation, to applying for college and throughout the visa process. It&rsquo;s the right place for students who require counseling guidance as they have an in-depth knowledge of the industry.&nbsp;They were very prompt in answering all my doubts and made the entire process very smooth.&nbsp;Everything was well explained, step by step in advance to avoid any kind of overlapping. The whole team is very supportive and trustworthy. I would highly&nbsp;recommend Knowledge Kingdom if you&rsquo;re looking for a hassle-free process for studying overseas.</p>', 0, '2023-09-29 10:44:12', '2023-09-29 10:44:12'),
(42, 'Aditi Shukla', 'public/image/admin/testimonial/6XA8DITNJqzLrKa6ZnwGxhj4LtcQUu7MEONjMUWn.jpg', 'Swansea University, UK', '<p>Had the best experience over here.Really helpful and experienced staff. They literally helped me with everything like my application process, university selection and visa as well. Today, I am finally leaving for London. All thanks to knowledge kingdom. Mani Mishra ma&#39;am is very kind and Shilpa ma&#39;am stays throughout the process with you. If you&#39;re planning to go abroad this is the best consultancy that you can opt for. So, make sure that you go for them because they really have great expertise in it. Thank you knowledge kingdom!</p>', 1, '2023-09-29 10:45:35', '2023-09-29 10:45:35'),
(43, 'Aadya Khare', 'public/image/admin/testimonial/miTZ6QREGDMcLdHuHEHGdBQQPT7v5QTENrctuNAf.jpg', 'University of East London, UK', '<p>Knowledge Kingdom is undoubtedly the best in their field, as they provided the required service from the very beginning of application by suggesting the appropriate study program and University that was suitable for me as per my requirements.<br />\r\nThey are very sincere about their duties and answer every single query one might have. They treat every application with the utmost priority and maintain transparency throughout the whole process. One educational consultancy firm anyone can blindly rely upon.</p>\r\n\r\n<p>Thank you Team Knowledge Kingdom for directing me to the right path.</p>', 1, '2023-09-29 10:47:50', '2023-09-29 10:47:50'),
(45, 'Pratibha Punj', 'public/image/admin/testimonial/yX48JHG8ptuR6biVKOag6H5VLnBQOWs7LQur3wzL.jpg', 'https://knowledgekingdom.in/testimonial', '<p>Fulfilling my dream of getting admission in one of the top universities would not have been possible without the constant support of&nbsp;<strong>Knowledge Kingdom</strong>&nbsp;and their team. I have also&nbsp;pursued the IELTS coaching from Knowledge Kingdom. They were more than responsible in fulfilling all my needs at every stage.&nbsp;My counsellor guided me throughout the whole process.&nbsp;&nbsp;Staffs over there helped me very patiently throughout which eventually leads me to obtain the student Visa for UK.</p>\r\n\r\n<p><strong>With Best Wishes from Pratibha Punj, University of Aberdeen, UK.</strong></p>', 1, '2023-10-03 09:31:51', '2023-10-03 09:31:51'),
(46, 'Tanshiq Patil', 'public/image/admin/testimonial/1E5FaauMBSfCah5kfyx04a98OzJr9a2O5kSKuWDC.jpg', 'University College London', 'I would highly recommend Knowledge Kingdom for anyone considering studying overseas. Their guidance throughout my journey starting from efficiently crafting the applications to seamless visa processing has been truly invaluable. They helped me make informed decisions at every step of the way and addressed all of my concerns promptly and thoroughly. A special mention to Shilpa Ma&rsquo;am and Mani Ma&rsquo;am who were incredibly supportive during what can be a very daunting process. I am immensely grateful for their guidance and if you&#39;re considering studying abroad, look no further than Knowledge Kingdom.', 1, '2025-06-02 03:52:28', '2025-06-02 03:52:28');
